import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';

const Header = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: 'white', borderBottom: '20px solid black', borderLeft: '750px solid black', borderRight: '390px solid black', borderTop: '20px solid black', position: 'relative' }}>
      <Toolbar sx={{ display: 'flex', justifyContent: 'space-between' }}>
        <Typography variant="h6" component="div" sx={{ color: 'black' }}>
          Your Website
        </Typography>
        <div style={{ position: 'absolute', right: '50px', top: '50%', transform: 'translateY(-50%)' }}>
          <AppBar position="static" sx={{ backgroundColor: 'black', borderBottom: 'none', borderLeft: '700px', borderRight: 'none', borderTop: 'none' }}>
            <Toolbar>
              <Button color="inherit">Login</Button>
              <Button color="inherit">SignUp</Button>
            </Toolbar>
          </AppBar>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
